import api from "../../request/api"
import { post, get, upload } from "src/request/api"
const headers = { 'Content-Type': 'application/x-www-form-urlencoded;charset=utf-8' }
// 获取银行卡类型
export const banks = (data = {}) => {
 return post('/pub/banks', data)
}

// 查询银行卡列表
export const queryBanks = (data = {}) => {
 return get('/api/v1/app/mine/query-cards', data)
}
// 删除
export const deleteBank = (params = {}) => {
 return api({
  url: '/api/v1/app/mine/delete-card',
  method: 'post',
  params,
  headers
 })
}
